package isola.model.html.list;import isola.helpers.ElementParserHtml;import isola.model.html.core.Container;/** *  *  *  * @author Umut Gokbayrak *  *  */public class Dl extends Container {	private static final String tag = "dl";	/**	 * 	 * @deprecated When set, this boolean attribute gives a hint to visual user	 *             agents to render the list in a more compact way. The	 *             interpretation of this attribute depends on the user agent.	 */	private String compact;		public Dl() {		super();		setId(tag + (Math.random() * 1000));	}		public Dl(String id) {		super(id);	}		public String getTag() {		return tag;	}		public String getCompact() {		return compact;	}		/**	 * 	 * @deprecated When set, this boolean attribute gives a hint to visual user	 *             agents to render the list in a more compact way. The	 *             interpretation of this attribute depends on the user agent.	 * 	 * 	 * 	 * @param compact	 */	public void setCompact(String compact) {		this.compact = compact;	}		@Override	public String toString() {		return ElementParserHtml.getToStringOut(this);	}}